$(document).ready(function(){
    // alert("Test");
    var headerHeight = $(".main-header").outerHeight(); 
    var sec = $(".first_section_grid").outerHeight();
    var container = $(".container");
    // const isMobile = navigator.userAgentData.mobile;
    const isMobile = checkDevice();
    $.ajax({
        url : '<?php echo admin_url('admin-ajax.php'); ?>',
        dataType : 'json',
        data : {action : 'diktyo_get_ajax'},
        success : function(resp){
            var iconAndContent = '';
            $.each(resp, function(index, val){
                var state = val['state_name'];
                var elm = $("path[state-name='"+state+"']");
                var position = elm.offset();
                position.left -= container.offset().left;
                if(isMobile == false)
                {
                    position.top -= headerHeight;
                    position.top -= sec;
                    position.top -= 40;
                    if($('body').hasClass('admin-bar'))
                    {
                        position.top -= 70;
                    }
                    // $('.popup-show-ddddd').attr('style','display:block; position:absolute; top:'+position.top+'px; left:'+position.left+'px;');
                }
                else if(isMobile == true)
                {
                    //position.top += headerHeight;
                    position.top -= sec;
                    // $('.popup-show-ddddd').attr('style','display:block; position:absolute; top:'+position.top+'px; left:'+position.left+'px;');
                }
                var i = parseInt(index) + 1;
                iconAndContent += '<span class="click-me map_icon_'+i+'" style="position:absolute; top: '+position.top+'px; left: '+position.left+'px;">'+
                                    '<img src="'+val['map_icon']+'" class="click_popup">'+
                                    '<div class="hover_show_map_detail" style="display:none !important;">'+
                                        '<button class="btn btn-primary cstm-close">X</button>'+
                                        val['map_content']+
                                    '</div>'+
                            '</span>';
                
            });
            $('.network_map_icon').html(iconAndContent);
        },
        error : function(resp){
            console.log(resp);
        }
    });
});

$(document).ready(function(){
   $('.network_map_icon').on('click', '.click_popup', function(){
